import { useEffect } from "react";
import useFetch from "../hooks/useFetch";

const Reserve = ({ setOpen, hotelId}) => {
  const {data, loading, error} = useFetch(`/api/hotels/room/${hotelId}`);
  return (
    <div className="reserve"></div>
  );
}
